import React from 'react'
import { useContextGlobal } from './utils/global.context'
import Card from './Card'
import { useEffect } from 'react'
import axios from 'axios'

const DentistList = () => {

    const {state,dispatch}=useContextGlobal()
   

    const endPoint='https://jsonplaceholder.typicode.com/users'

  useEffect(()=>{
    axios(endPoint)
    .then(res => dispatch({type: 'get_dentists' , payload: res.data},console.log(res.data)))
    
  },[])
  console.log('state'+state.dentistas)
  return (
    <div className='listDentist'>
        {state.dentistas.map((dentista)=><Card odontologo={dentista} key={dentista.id}/>)}
    </div>
  )
}

export default DentistList
